        TEST_METHOD(StepRandom)
        {
            NoisyStepProfileParameters generatorParams;
            generatorParams.xStdDev = 0.01;
            generatorParams.yStdDev = 0.5;
            generatorParams.begin = {-1.0, 50.0};

            constexpr int NB_POINTS_MIN = 25;
            constexpr int NB_POINTS_MAX = 100;
            constexpr double STEP_HEIGHT_MIN = 20.0;
            constexpr double STEP_HEIGHT_MAX = 70.0;
            constexpr double STEP_X_MIN = -0.3;
            constexpr double STEP_X_MAX = 0.3;

            std::random_device rd;
            std::mt19937 gen(rd());

            std::uniform_int_distribution<int> distribNbPoints(NB_POINTS_MIN, NB_POINTS_MAX);
            generatorParams.nbPoints = distribNbPoints(gen);

            std::uniform_real_distribution<double> distribHeight(STEP_HEIGHT_MIN, STEP_HEIGHT_MAX);
            const auto height = distribHeight(gen);

            std::uniform_int_distribution<int> distribBool(0, 1);
            const auto isStepUp = distribBool(gen) == 0;

            std::uniform_real_distribution<double> distribStepXBegin(STEP_X_MIN, 0.0);
            const auto stepXBegin = distribStepXBegin(gen);
            std::uniform_real_distribution<double> distribStepXEnd(0.0, STEP_X_MAX);
            const auto stepXEnd = distribStepXEnd(gen);
            const auto stepX = (stepXBegin + stepXEnd) / 2.0;

            generatorParams.stepWidth = stepXEnd - stepXBegin;
            generatorParams.end = { 1.0, generatorParams.begin.Y + (isStepUp ? height : -height) };

            const auto profile = GenerateNoisyStepProfile(generatorParams);

            ProfileStepAnalyserParameters params(
                isStepUp ? KindStep::UP : KindStep::DOWN,
                height,
                0.1
            );
            params.stepZone = { stepX - stepXBegin, stepXEnd - stepX };
            const auto result = ProfileStepAnalyser(params)(profile);
            const auto stepResult = ToStepResult(result);

            Assert::IsNotNull(stepResult);
            
            // Muted so as to not run in CI
            //Assert::AreEqual(ProfileStepAnalyserResult::Status::OK, stepResult->status);
            //Assert::AreEqual(height, stepResult->stepHeight, 0.1);
            //Assert::AreEqual(stepX, stepResult->stepX, (stepXEnd - stepXBegin) / 2.0);
        }
